import React from 'react'

import './CategoryCard.css'
function  CategoryCard({category}) {
    return (
        <div className='category-card'>
            <div>
                pics
            </div>
            <div className='category-title'> <p>{category.name}</p><p>{category.count}</p></div>
        </div>
    )

}

export default CategoryCard
